import React from 'react';
import ScriptTag from 'react-script-tag';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    // Redirect,
} from "react-router-dom";

import Home from './app/Home/Home';
import LandingPage from './app/Login/LandingPage';


function App() {
    
   

    return (
        <Router>
            <Switch>
                <Route path="/home">
                    <Home />
                </Route>
                
                <Route path="/">
                    <LandingPage />
                </Route>
            
            </Switch>

       
            <ScriptTag isHydrating={true} type="text/javascript" src="./assets/carousel/js/JQuery3.3.1.js" />
            <ScriptTag isHydrating={true} type="text/javascript" src="./assets/carousel/js/lightslider.js" />
            <ScriptTag isHydrating={true} type="text/javascript" src="../assets/carousel/js/script.js" />
        </Router>
    );
}

export default App;
